import * as React from 'react';
import {
    Text,
    View,
    Stylesheet,
    TextInput,
    ImageBackground,
    TouchableOpacity,
    Image,
    ActivityIndicator
} from 'react-native';

const ResourcesTips = () => {
    return(
        < View >
            <Text> This is the resources and tips tab </Text>
        </View>
    );
}
export default ResourcesTips;
